window.onload = function() {
    const canvas = document.getElementById('glCanvas');
    const gl = canvas.getContext('webgl') || canvas.getContext('experimental-webgl');

    if (!gl) {
        alert('WebGL not supported by your browser.');
        return;
    }

    const projectionMatrix = mat4.create();

    function resizeCanvas() {
        canvas.width = window.innerWidth;
        canvas.height = window.innerHeight;
        gl.viewport(0, 0, canvas.width, canvas.height);
        updateProjectionMatrix();
    }
    window.addEventListener('resize', resizeCanvas);
    resizeCanvas();

    gl.enable(gl.DEPTH_TEST);

    gl.clearColor(1.0, 1.0, 1.0, 1.0);

    const SHADING_MODES = {
        WIREFRAME: 'wireframe',
        GOURAUD: 'gouraud',
        PHONG: 'phong'
    };
    let currentShading = SHADING_MODES.WIREFRAME;

    // UI
    const uStepsSlider = document.getElementById('uSteps');
    const vStepsSlider = document.getElementById('vSteps');
    const uStepsVal = document.getElementById('uStepsVal');
    const vStepsVal = document.getElementById('vStepsVal');
    
    const regenerateButton = document.getElementById('regenerate');
    const wireframeButton = document.getElementById('wireframe');
    const gouraudButton = document.getElementById('gouraud');
    const phongButton = document.getElementById('phong');

    const wireframeColorPicker = document.getElementById('wireframeColor');
    const gouraudColorPicker = document.getElementById('gouraudColor');
    const phongColorPicker = document.getElementById('phongColor');
    const bgColorPicker = document.getElementById('bgColor');

    const diffuseMapInput = document.getElementById('diffuseMap');
    const loadDiffuseMapButton = document.getElementById('loadDiffuseMap');
    const normalMapInput = document.getElementById('normalMap');
    const loadNormalMapButton = document.getElementById('loadNormalMap');

    const uMinSlider = document.getElementById('uMin');
    const uMaxSlider = document.getElementById('uMax');
    const vMinSlider = document.getElementById('vMin');
    const vMaxSlider = document.getElementById('vMax');
    const uMinVal = document.getElementById('uMinVal');
    const uMaxVal = document.getElementById('uMaxVal');
    const vMinVal = document.getElementById('vMinVal');
    const vMaxVal = document.getElementById('vMaxVal');

    let uvParameters = {
        uMin: 0,
        uMax: 2 * Math.PI,
        vMin: 0,
        vMax: Math.PI
    };

    uStepsVal.textContent = uStepsSlider.value;
    vStepsVal.textContent = vStepsSlider.value;

    uStepsSlider.oninput = function() {
        uStepsVal.textContent = this.value;
    };
    vStepsSlider.oninput = function() {
        vStepsVal.textContent = this.value;
    };
    
    uMinSlider.oninput = function() {
        uMinVal.textContent = this.value;
        uvParameters.uMin = parseFloat(this.value);
        regenerateSurface();
    };

    uMaxSlider.oninput = function() {
        uMaxVal.textContent = this.value;
        uvParameters.uMax = parseFloat(this.value);
        regenerateSurface();
    };

    vMinSlider.oninput = function() {
        vMinVal.textContent = this.value;
        uvParameters.vMin = parseFloat(this.value);
        regenerateSurface();
    };

    vMaxSlider.oninput = function() {
        vMaxVal.textContent = this.value;
        uvParameters.vMax = parseFloat(this.value);
        regenerateSurface();
    };
    function hexToRgb(hex) {
        hex = hex.replace(/^#/, '');
        let bigint = parseInt(hex, 16);
        let r, g, b;
        if (hex.length === 6) {
            r = (bigint >> 16) & 255;
            g = (bigint >> 8) & 255;
            b = bigint & 255;
        } else if (hex.length === 3) {
            r = ((bigint >> 8) & 15) * 17;
            g = ((bigint >> 4) & 15) * 17;
            b = (bigint & 15) * 17;
        } else {
            return [1.0, 1.0, 1.0];
        }
        return [r / 255, g / 255, b / 255];
    }

    // Gouraud Shaders
    const vertexShaderSourceGouraud = `
        attribute vec3 aPosition;
        attribute vec3 aNormal;
        attribute vec2 aUV;

        uniform mat4 uModelViewMatrix;
        uniform mat4 uProjectionMatrix;
        uniform mat3 uNormalMatrix;
        uniform vec3 uLightPosition;
        uniform vec3 uDiffuseColor;
        uniform sampler2D uNormalMap;
        uniform bool uUseBumpMap;
        uniform sampler2D uDiffuseMap;

        varying vec3 vColor;

        void main(void) {
            vec3 normal = normalize(uNormalMatrix * aNormal);
            if(uUseBumpMap) {
                vec3 tangentNormal = texture2D(uNormalMap, aUV).rgb;
                tangentNormal = tangentNormal * 2.0 - 1.0;
                normal = normalize(tangentNormal);
            }
            vec3 vertexPosition = (uModelViewMatrix * vec4(aPosition, 1.0)).xyz;
            vec3 lightDir = normalize(uLightPosition - vertexPosition);
            float diff = max(dot(normal, lightDir), 0.0);
            vec2 scaledUV = aUV * vec2(2.0, 2.0);
            vec4 texColor = texture2D(uDiffuseMap, scaledUV);
            vec3 diffuse = (uDiffuseColor * texColor.rgb) * diff;
            vColor = diffuse;
            gl_Position = uProjectionMatrix * vec4(vertexPosition, 1.0);
        }
    `;

    const fragmentShaderSourceGouraud = `
        precision mediump float;
        varying vec3 vColor;

        void main(void) {
            gl_FragColor = vec4(vColor, 1.0);
        }
    `;

    // Phong Shaders
    const vertexShaderSourcePhong = `
        attribute vec3 aPosition;
        attribute vec3 aNormal;
        attribute vec2 aUV;

        uniform mat4 uModelViewMatrix;
        uniform mat4 uProjectionMatrix;
        uniform mat3 uNormalMatrix;
        uniform vec3 uLightPosition;
        uniform sampler2D uNormalMap;
        uniform bool uUseBumpMap;
        uniform sampler2D uDiffuseMap;

        varying vec3 vNormal;
        varying vec3 vPosition;
        varying vec2 vUV;

        void main(void) {
            vNormal = normalize(uNormalMatrix * aNormal);
            vPosition = (uModelViewMatrix * vec4(aPosition, 1.0)).xyz;
            vUV = aUV;
            if(uUseBumpMap) {
                vec3 tangentNormal = texture2D(uNormalMap, aUV).rgb;
                tangentNormal = tangentNormal * 2.0 - 1.0;
                vNormal = normalize(tangentNormal);
            }
            gl_Position = uProjectionMatrix * vec4(vPosition, 1.0);
        }
    `;

    const fragmentShaderSourcePhong = `
        precision mediump float;

        varying vec3 vNormal;
        varying vec3 vPosition;
        varying vec2 vUV;

        uniform vec3 uLightPosition;
        uniform vec3 uDiffuseColor;
        uniform sampler2D uDiffuseMap;

        void main(void) {
            vec3 normal = normalize(vNormal);
            vec3 lightDir = normalize(uLightPosition - vPosition);
            float diff = max(dot(normal, lightDir), 0.0);
            vec4 texColor = texture2D(uDiffuseMap, vUV);
            vec3 diffuse = (uDiffuseColor * texColor.rgb) * diff;
            gl_FragColor = vec4(diffuse, 1.0);
        }
    `;

    // Wireframe Shaders
    const vertexShaderSourceWireframe = `
        attribute vec3 aPosition;

        uniform mat4 uModelViewMatrix;
        uniform mat4 uProjectionMatrix;

        void main(void) {
            gl_Position = uProjectionMatrix * uModelViewMatrix * vec4(aPosition, 1.0);
        }
    `;

    const fragmentShaderSourceWireframe = `
        precision mediump float;

        uniform vec4 uColor;

        void main(void) {
            gl_FragColor = uColor;
        }
    `;

    function compileShader(source, type) {
        const shader = gl.createShader(type);
        gl.shaderSource(shader, source);
        gl.compileShader(shader);
        if (!gl.getShaderParameter(shader, gl.COMPILE_STATUS)) {
            console.error('Shader compile failed with: ' + gl.getShaderInfoLog(shader));
            gl.deleteShader(shader);
            return null;
        }
        return shader;
    }

    function createProgram(vertexSource, fragmentSource) {
        const vertexShader = compileShader(vertexSource, gl.VERTEX_SHADER);
        const fragmentShader = compileShader(fragmentSource, gl.FRAGMENT_SHADER);

        const program = gl.createProgram();
        gl.attachShader(program, vertexShader);
        gl.attachShader(program, fragmentShader);
        gl.linkProgram(program);

        if (!gl.getProgramParameter(program, gl.LINK_STATUS)) {
            console.error('Program failed to link: ' + gl.getProgramInfoLog(program));
            gl.deleteProgram(program);
            return null;
        }

        return program;
    }

    const programGouraud = createProgram(vertexShaderSourceGouraud, fragmentShaderSourceGouraud);
    const programPhong = createProgram(vertexShaderSourcePhong, fragmentShaderSourcePhong);
    const programWireframe = createProgram(vertexShaderSourceWireframe, fragmentShaderSourceWireframe);
    let currentProgram = programWireframe;

    let surfaceData = generateBoySurface(
        { 
            min: uvParameters.uMin, 
            max: uvParameters.uMax, 
            steps: parseInt(uStepsSlider.value) 
        },
        { 
            min: uvParameters.vMin, 
            max: uvParameters.vMax, 
            steps: parseInt(vStepsSlider.value) 
        },
        0.01,
        0.01
    );

    let positionBuffer = gl.createBuffer();
    let normalBuffer = gl.createBuffer();
    let uvBuffer = gl.createBuffer();
    let indexBuffer = gl.createBuffer();

    function initBuffers() {
        gl.bindBuffer(gl.ARRAY_BUFFER, positionBuffer);
        gl.bufferData(gl.ARRAY_BUFFER, new Float32Array(surfaceData.vertices), gl.STATIC_DRAW);

        gl.bindBuffer(gl.ARRAY_BUFFER, normalBuffer);
        gl.bufferData(gl.ARRAY_BUFFER, new Float32Array(surfaceData.normals), gl.STATIC_DRAW);

        gl.bindBuffer(gl.ARRAY_BUFFER, uvBuffer);
        gl.bufferData(gl.ARRAY_BUFFER, new Float32Array(surfaceData.uvs), gl.STATIC_DRAW);

        gl.bindBuffer(gl.ELEMENT_ARRAY_BUFFER, indexBuffer);
        gl.bufferData(gl.ELEMENT_ARRAY_BUFFER, new Uint16Array(surfaceData.indices), gl.STATIC_DRAW);
    }

    initBuffers();

    function boySurface(u, v) {
        const sqrt2 = Math.sqrt(2);
        const denominator = 2 - sqrt2 * Math.sin(3 * u) * Math.sin(2 * v);

        const x = (sqrt2 * Math.cos(v) * Math.cos(v) * Math.cos(2 * u) + Math.cos(u) * Math.sin(2 * v)) / denominator;
        const y = (sqrt2 * Math.cos(v) * Math.cos(v) * Math.sin(2 * u) - Math.sin(u) * Math.sin(2 * v)) / denominator;
        const z = (3 * Math.cos(v) * Math.cos(v)) / denominator;

        return [x, y, z];
    }

    function computeNormal(u, v) {
        const delta = 0.0001;
        const p = boySurface(u, v);
        const pu = boySurface(u + delta, v);
        const pv = boySurface(u, v + delta);

        const tangentU = [
            pu[0] - p[0],
            pu[1] - p[1],
            pu[2] - p[2]
        ];
        const tangentV = [
            pv[0] - p[0],
            pv[1] - p[1],
            pv[2] - p[2]
        ];
        const normal = [
            tangentU[1] * tangentV[2] - tangentU[2] * tangentV[1],
            tangentU[2] * tangentV[0] - tangentU[0] * tangentV[2],
            tangentU[0] * tangentV[1] - tangentU[1] * tangentV[0]
        ];

        const length = Math.hypot(normal[0], normal[1], normal[2]);
        return normal.map(coord => coord / length);
    }

    // for base64 texturing
    function isPowerOfTwo(value) {
        return (value & (value - 1)) === 0;
    }

    // MAIN generation function
    function generateBoySurface(uRange, vRange, uStep, vStep) {
        const vertices = [];
        const normals = [];
        const uvs = [];
        const indices = [];
    
        const uMin = uRange.min;
        const uMax = uRange.max;
        const vMin = vRange.min;
        const vMax = vRange.max;
        const uSteps = uRange.steps;
        const vSteps = vRange.steps;
    
        for (let i = 0; i <= uSteps; i++) {
            const u = uMin + (uMax - uMin) * i / uSteps;
            for (let j = 0; j <= vSteps; j++) {
                const v = vMin + (vMax - vMin) * j / vSteps;
                const [x, y, z] = boySurface(u, v);
                vertices.push(x, y, z);
    
                const normal = computeNormal(u, v);
                normals.push(normal[0], normal[1], normal[2]);

                const uScale = 2.0;
                const vScale = 2.0;
                uvs.push((z + 1.0) * 0.5 * uScale, (y + 1.0) * 0.5 * vScale);

                //const u_normalized = (u - uMin) / (uMax - uMin);
                //const v_normalized = (v - vMin) / (vMax - vMin);

                //uvs.push(u_normalized * uScale, v_normalized * vScale);

            }
        }
        for (let i = 0; i < uSteps; i++) {
            for (let j = 0; j < vSteps; j++) {
                const a = i * (vSteps + 1) + j;
                const b = (i + 1) * (vSteps + 1) + j;
                const c = (i + 1) * (vSteps + 1) + (j + 1);
                const d = i * (vSteps + 1) + (j + 1);
    
                indices.push(a, b, c);
                indices.push(a, c, d);
            }
        }
        return { vertices, normals, uvs, indices };
    }
        
    function updateProjectionMatrix() {
        const fieldOfView = 45 * Math.PI / 180;
        const aspect = canvas.clientWidth / canvas.clientHeight;
        const zNear = 0.1;
        const zFar = 100.0;
        mat4.perspective(projectionMatrix, fieldOfView, aspect, zNear, zFar);
    }

    updateProjectionMatrix();

    const modelViewMatrix = mat4.create();
    const normalMatrix = mat3.create();

    // camera position
    let rotation = { x: 0, y: 0 };
    let zoom = -5;
    let isDragging = false;
    let previousMousePosition = { x: 0, y: 0 };

    // light Position
    const lightPosition = [10, 10, 10];

    canvas.addEventListener('mousedown', (e) => {
        isDragging = true;
        previousMousePosition = { x: e.clientX, y: e.clientY };
    });

    canvas.addEventListener('mousemove', (e) => {
        if (isDragging) {
            const deltaX = e.clientX - previousMousePosition.x;
            const deltaY = e.clientY - previousMousePosition.y;
            rotation.y += deltaX * 0.005;
            rotation.x += deltaY * 0.005;
            previousMousePosition = { x: e.clientX, y: e.clientY };
        }
    });

    canvas.addEventListener('mouseup', () => {
        isDragging = false;
    });

    canvas.addEventListener('mouseleave', () => {
        isDragging = false;
    });

    canvas.addEventListener('wheel', (e) => {
        e.preventDefault();
        zoom += e.deltaY * -0.01;
        if (zoom > -2) zoom = -2;
        if (zoom < -20) zoom = -20;
    }, { passive: false });

    function updateMatrices() {
        mat4.identity(modelViewMatrix);
        mat4.translate(modelViewMatrix, modelViewMatrix, [0, 0, zoom]);
        mat4.rotateX(modelViewMatrix, modelViewMatrix, rotation.x);
        mat4.rotateY(modelViewMatrix, modelViewMatrix, rotation.y);

        mat3.normalFromMat4(normalMatrix, modelViewMatrix);
    }

    function setActiveButton(activeButton) {
        [wireframeButton, gouraudButton, phongButton].forEach(btn => btn.classList.remove('active'));
        activeButton.classList.add('active');
    }

    wireframeButton.addEventListener('click', () => {
        currentProgram = programWireframe;
        currentShading = SHADING_MODES.WIREFRAME;
        setActiveButton(wireframeButton);
    });

    gouraudButton.addEventListener('click', () => {
        currentProgram = programGouraud;
        currentShading = SHADING_MODES.GOURAUD;
        setActiveButton(gouraudButton);
    });

    phongButton.addEventListener('click', () => {
        currentProgram = programPhong;
        currentShading = SHADING_MODES.PHONG;
        setActiveButton(phongButton);
    });

    function handleColorChange() {
        const bgColor = hexToRgb(bgColorPicker.value);
        gl.clearColor(bgColor[0], bgColor[1], bgColor[2], 1.0);
    }

    wireframeColorPicker.addEventListener('input', () => {
        if (currentShading === SHADING_MODES.WIREFRAME) {
            const wireColor = hexToRgb(wireframeColorPicker.value);
            gl.useProgram(currentProgram);
            const uColorLocation = gl.getUniformLocation(currentProgram, 'uColor');
            if (uColorLocation !== -1) {
                gl.uniform4fv(uColorLocation, [...wireColor, 1.0]);
            }
        }
    });

    gouraudColorPicker.addEventListener('input', () => {
        if (currentShading === SHADING_MODES.GOURAUD) {
            const gouraudColor = hexToRgb(gouraudColorPicker.value);
            gl.useProgram(currentProgram);
            const uDiffuseColorLocation = gl.getUniformLocation(currentProgram, 'uDiffuseColor');
            if (uDiffuseColorLocation !== -1) {
                gl.uniform3fv(uDiffuseColorLocation, gouraudColor);
            }
        }
    });

    phongColorPicker.addEventListener('input', () => {
        if (currentShading === SHADING_MODES.PHONG) {
            const phongColor = hexToRgb(phongColorPicker.value);
            gl.useProgram(currentProgram);
            const uDiffuseColorLocation = gl.getUniformLocation(currentProgram, 'uDiffuseColor');
            if (uDiffuseColorLocation !== -1) {
                gl.uniform3fv(uDiffuseColorLocation, phongColor);
            }
        }
    });

    bgColorPicker.addEventListener('input', handleColorChange);

    handleColorChange();

    let diffuseTexture = gl.createTexture();
    let diffuseImage = new Image();
    let diffuseMapLoaded = false;

    const defaultDiffuseMapBase64 = 
    'data:image/jpeg;base64,';

    const defaultNormalMapBase64 = 
    'data:image/jpeg;base64,';

    function loadDiffuseMapFromBase64(base64) {
        diffuseImage = new Image();
        diffuseImage.onload = function() {
            gl.bindTexture(gl.TEXTURE_2D, diffuseTexture);


            gl.pixelStorei(gl.UNPACK_FLIP_Y_WEBGL, true);
            gl.texImage2D(gl.TEXTURE_2D, 0, gl.RGBA, gl.RGBA, gl.UNSIGNED_BYTE, diffuseImage);

            if (isPowerOfTwo(diffuseImage.width) && isPowerOfTwo(diffuseImage.height)) {
                gl.generateMipmap(gl.TEXTURE_2D);
                gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_MIN_FILTER, gl.LINEAR_MIPMAP_LINEAR);
            } else {
                gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_MIN_FILTER, gl.LINEAR);
                gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_WRAP_S, gl.REPEAT);
                gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_WRAP_T, gl.REPEAT);
            }            

            diffuseMapLoaded = true;
        };
        diffuseImage.onerror = function() {
            console.error('Failed to load diffuse texture image.');
            diffuseMapLoaded = false;
        };
        diffuseImage.src = base64;
    }

    loadDiffuseMapFromBase64(defaultDiffuseMapBase64);

    let normalMapTexture = gl.createTexture();
    let normalMapImage = new Image();
    let normalMapLoaded = false;

    function loadNormalMapFromBase64(base64) {
        normalMapImage = new Image();
        normalMapImage.onload = function() {
            gl.bindTexture(gl.TEXTURE_2D, normalMapTexture);
            gl.pixelStorei(gl.UNPACK_FLIP_Y_WEBGL, true);
            gl.texImage2D(gl.TEXTURE_2D, 0, gl.RGBA, gl.RGBA, gl.UNSIGNED_BYTE, normalMapImage);

            if (isPowerOfTwo(normalMapImage.width) && isPowerOfTwo(normalMapImage.height)) {
                gl.generateMipmap(gl.TEXTURE_2D);
                gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_MIN_FILTER, gl.LINEAR_MIPMAP_LINEAR);
            } else {
                gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_MIN_FILTER, gl.LINEAR);
                gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_WRAP_S, gl.REPEAT);
                gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_WRAP_T, gl.REPEAT);
            }   

            normalMapLoaded = true;
        };
        normalMapImage.onerror = function() {
            console.error('Failed to load normal map image.');
            normalMapLoaded = false;
        };
        normalMapImage.src = base64;
    }

    loadNormalMapFromBase64(defaultNormalMapBase64);

    loadDiffuseMapButton.addEventListener('click', () => {
        const file = diffuseMapInput.files[0];
        if (!file) {
            alert('Please select an image file for the diffuse texture.');
            return;
        }

        const reader = new FileReader();
        reader.onload = function(e) {
            loadDiffuseMapFromBase64(e.target.result);
        };
        reader.onerror = function() {
            console.error('Failed to read diffuse texture file.');
            diffuseMapLoaded = false;
        };
        reader.readAsDataURL(file);
    });

    loadNormalMapButton.addEventListener('click', () => {
        const file = normalMapInput.files[0];
        if (!file) {
            alert('Please select an image file for the normal map.');
            return;
        }

        const reader = new FileReader();
        reader.onload = function(e) {
            loadNormalMapFromBase64(e.target.result);
        };
        reader.onerror = function() {
            console.error('Failed to read normal map file.');
            normalMapLoaded = false;
        };
        reader.readAsDataURL(file);
    });

    function drawScene() {
        gl.clear(gl.COLOR_BUFFER_BIT | gl.DEPTH_BUFFER_BIT);

        updateMatrices();

        gl.useProgram(currentProgram);

        const positionLoc = gl.getAttribLocation(currentProgram, 'aPosition');
        gl.bindBuffer(gl.ARRAY_BUFFER, positionBuffer);
        gl.enableVertexAttribArray(positionLoc);
        gl.vertexAttribPointer(positionLoc, 3, gl.FLOAT, false, 0, 0);

        if (currentShading !== SHADING_MODES.WIREFRAME) {
            const normalLoc = gl.getAttribLocation(currentProgram, 'aNormal');
            gl.bindBuffer(gl.ARRAY_BUFFER, normalBuffer);
            if (normalLoc === -1) {
                console.warn('Normal attribute not found in current shader.');
            } else {
                gl.enableVertexAttribArray(normalLoc);
                gl.vertexAttribPointer(normalLoc, 3, gl.FLOAT, false, 0, 0);
            }

            const uvLoc = gl.getAttribLocation(currentProgram, 'aUV');
            gl.bindBuffer(gl.ARRAY_BUFFER, uvBuffer);
            if (uvLoc === -1) {
                console.warn('UV attribute not found in current shader.');
            } else {
                gl.enableVertexAttribArray(uvLoc);
                gl.vertexAttribPointer(uvLoc, 2, gl.FLOAT, false, 0, 0);
            }
        }

        gl.bindBuffer(gl.ELEMENT_ARRAY_BUFFER, indexBuffer);

        const uModelViewMatrix = gl.getUniformLocation(currentProgram, 'uModelViewMatrix');
        const uProjectionMatrix = gl.getUniformLocation(currentProgram, 'uProjectionMatrix');
        const uNormalMatrix = gl.getUniformLocation(currentProgram, 'uNormalMatrix');

        gl.uniformMatrix4fv(uModelViewMatrix, false, modelViewMatrix);
        gl.uniformMatrix4fv(uProjectionMatrix, false, projectionMatrix);
        gl.uniformMatrix3fv(uNormalMatrix, false, normalMatrix);

        if (currentShading === SHADING_MODES.GOURAUD) {
            const gouraudColor = hexToRgb(gouraudColorPicker.value);
            const uDiffuseColor = gl.getUniformLocation(currentProgram, 'uDiffuseColor');
            if (uDiffuseColor !== -1) {
                gl.uniform3fv(uDiffuseColor, gouraudColor);
            }

            if (diffuseMapLoaded) {
                gl.activeTexture(gl.TEXTURE0);
                gl.bindTexture(gl.TEXTURE_2D, diffuseTexture);
                gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_WRAP_S, gl.REPEAT);
                gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_WRAP_T, gl.REPEAT);

                const uDiffuseMapLocation = gl.getUniformLocation(currentProgram, 'uDiffuseMap');
                gl.uniform1i(uDiffuseMapLocation, 0);
            }

            if (normalMapLoaded) {
                gl.activeTexture(gl.TEXTURE1);
                gl.bindTexture(gl.TEXTURE_2D, normalMapTexture);
                const uNormalMapLocation = gl.getUniformLocation(currentProgram, 'uNormalMap');
                gl.uniform1i(uNormalMapLocation, 1);
            }

            const uUseBumpMap = gl.getUniformLocation(currentProgram, 'uUseBumpMap');
            gl.uniform1i(uUseBumpMap, normalMapLoaded ? 1 : 0);
        }

        if (currentShading === SHADING_MODES.PHONG) {
            const phongColor = hexToRgb(phongColorPicker.value);
            const uDiffuseColor = gl.getUniformLocation(currentProgram, 'uDiffuseColor');
            if (uDiffuseColor !== -1) {
                gl.uniform3fv(uDiffuseColor, phongColor);
            }

            if (diffuseMapLoaded) {
                gl.activeTexture(gl.TEXTURE0);
                gl.bindTexture(gl.TEXTURE_2D, diffuseTexture);
                gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_WRAP_S, gl.REPEAT);
                gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_WRAP_T, gl.REPEAT);

                const uDiffuseMapLocation = gl.getUniformLocation(currentProgram, 'uDiffuseMap');
                gl.uniform1i(uDiffuseMapLocation, 0);
            }

            if (normalMapLoaded) {
                gl.activeTexture(gl.TEXTURE1);
                gl.bindTexture(gl.TEXTURE_2D, normalMapTexture);
                const uNormalMapLocation = gl.getUniformLocation(currentProgram, 'uNormalMap');
                gl.uniform1i(uNormalMapLocation, 1);
            }

            const uUseBumpMap = gl.getUniformLocation(currentProgram, 'uUseBumpMap');
            gl.uniform1i(uUseBumpMap, normalMapLoaded ? 1 : 0);
        }

        if (currentShading === SHADING_MODES.WIREFRAME) {
            const wireColor = hexToRgb(wireframeColorPicker.value);
            const uColor = gl.getUniformLocation(currentProgram, 'uColor');
            if (uColor !== -1) {
                gl.uniform4fv(uColor, [...wireColor, 1.0]);
            }
        }

        if (currentShading === SHADING_MODES.GOURAUD || currentShading === SHADING_MODES.PHONG) {
            gl.uniform3fv(gl.getUniformLocation(currentProgram, 'uLightPosition'), lightPosition);
        }

        if (currentShading === SHADING_MODES.WIREFRAME) {
            gl.drawElements(gl.LINES, surfaceData.indices.length, gl.UNSIGNED_SHORT, 0);
        } else {
            gl.drawElements(gl.TRIANGLES, surfaceData.indices.length, gl.UNSIGNED_SHORT, 0);
        }
        requestAnimationFrame(drawScene);
    }

    function regenerateSurface() {
        surfaceData = generateBoySurface(
            { 
                min: uvParameters.uMin, 
                max: uvParameters.uMax, 
                steps: parseInt(uStepsSlider.value) 
            },
            { 
                min: uvParameters.vMin, 
                max: uvParameters.vMax, 
                steps: parseInt(vStepsSlider.value) 
            },
            0.01,
            0.01
        );
        initBuffers();
    }
    regenerateButton.addEventListener('click', regenerateSurface);
 
    requestAnimationFrame(drawScene);
};

 


